import CartButton from "./CartButton";
import classes from "./Header.module.css"

const Header=()=>{
    return <div className={classes.main}>
        <ul>
            <li>HOME</li>
            <li>STORE</li>
            <li>ABOUT</li>
        </ul>
        <CartButton />
    </div>
}

export default Header;
